import React from 'react';
import logo from './media/Roomie.png';
import pic from './media/roommates.jpg';
import './style.css';

function LoginPage() {
    return (
        <>
        <img src={logo} className="logos" alt="Logo" />
        <div>
        <h2 className='text-read'>Welcome to Roomies! Sign up to join!</h2>
        <label className='text-read'>enter email:</label>
        <input type="text" />
        <label className='text-read'>enter password:</label>
        <input type="password" />
        </div>
        <img src={pic} className='picture' alt="picture"/> 
        </>
    )
}

export default LoginPage
